import { createTechs } from "../actions/techActions";

import "../css_styles/TechCreate.css";

const TechCreateNewsApi= () => {
  const [author, setAuthor] = useState("");
  const [title, setTitle] = useState("");
  const [description, setDescription] = useState("");
  const [url, setUrl] = useState("");
  const [urlToImage, setUrlToImage] = useState("");
  const [publishedAt, setPublishedAt] = useState("");
  const [content, setContent] = useState("");

  // const [techs, setTechs] = useState([]);
  const newsApiKey = "d049a308e4634c8b8a28ce3b4b3059be";
  const dispatch = useDispatch();


  // const submitHandler = (tech) => {
  //   dispatch(
  //     createTechs({
  //       "author":tech.author,
  //       "title": tech.title,
  //       "description":tech.description,
  //       "url":tech.url,
  //       "urlToImage":tech.urlToImage,
  //       "publishedAt":tech.publishedAt,
  //       "content":tech.content
  //     })
  //   )
  //   console.log("clicked", author);
  // };


  //   FETCH THE DATA
  const techNewsApi = () => async () => {
    console.log("Fetching api");

    const { data } = await axios.get(
      `https://newsapi.org/v2/top-headlines?country=in&category=technology&apiKey=${newsApiKey}`
    );

    const techs = data.articles

    console.log("datas", data);
    console.log("techs1", techs[0].title);
    // setTechs(datas);
    console.log("techs2", techs);


    techs && techs.map((tech) => {

      return (
          console.log("interval start"),
          console.log("hi", tech.author),
          setAuthor(JSON.stringify(tech.author)),
          setTitle(JSON.stringify(tech.title)),
          setDescription(JSON.stringify(tech.description)),
          setUrl(JSON.stringify(tech[0].url)),
          setUrlToImage(JSON.stringify(tech[0].urlToImage)),
          setPublishedAt(JSON.stringify(tech[0].publishedAt)),
          setContent(JSON.stringify(tech[0].content)),
          console.log("interval ended"),

          // submitHandler(),


          console.log("inside map last line"),

          dispatch(createTechs(
            author,
            title,
            description,
            url,
            urlToImage,
            publishedAt,
            content
          )
        )
          // dispatch(createTechs({
          //     "author":tech[0].author,
          //     "title": tech[0].title,
          //     "description":tech[0].description,
          //     "url":tech[0].url,
          //     "urlToImage":tech[0].urlToImage,
          //     "publishedAt":tech[0].publishedAt,
          //     "content":tech[0].content
          //   })
          // ),
          // console.log("dispatch finished")

          )
        });
    };







  return (
    <>
      <div className="techcreate">
        <button onClick={techNewsApi()}>click</button>
        <div >Title -- {title && <h2>{title}</h2>}</div>
        <div >Author -- {author && <h2>{author}</h2>}</div>
      </div>
    </>
  );
};

export default TechCreateNewsApi;
